patch:
--- src/gourdon/AC.cpp
@@ -278,9 +278,17 @@ T AC_OpenMP(T x,
         int64_t high = low + segment_size;
         high = std::min(high, sqrtx);
         segmentedPi.init(low, high);
+
+        // We measure the thread computation time excluding the
+        // first expensive initialization of the segmentedPi
+        // lookup table. If the thread computation time is close
+        // to 0, then we increase the number of segments in the
+        // loadBalancer which should improve performance.
+        if (low == thread.low)
+          thread.secs = get_time();
+
         T xlow = x / max(low, 1);
         T xhigh = x / high;
-
         int64_t min_c2 = max(k, pi_root3_xy);
         min_c2 = max(min_c2, pi_sqrtz);
         min_c2 = max(min_c2, pi[isqrt(low)]);
--- src/gourdon/AC_libdivide.cpp
@@ -393,9 +393,17 @@ T AC_OpenMP(T x,
         int64_t high = low + segment_size;
         high = std::min(high, sqrtx);
         segmentedPi.init(low, high);
+
+        // We measure the thread computation time excluding the
+        // first expensive initialization of the segmentedPi
+        // lookup table. If the thread computation time is close
+        // to 0, then we increase the number of segments in the
+        // loadBalancer which should improve performance.
+        if (low == thread.low)
+          thread.secs = get_time();
+
         T xlow = x / max(low, 1);
         T xhigh = x / high;
-
         int64_t min_c2 = max(k, pi_root3_xy);
         min_c2 = max(min_c2, pi_sqrtz);
         min_c2 = max(min_c2, pi[isqrt(low)]);
--- src/gourdon/LoadBalancerAC.cpp
@@ -87,7 +87,7 @@ bool LoadBalancerAC::get_work(ThreadDataAC& thread)
     start_time_ = time;

   double total_secs = time - start_time_;
-  double increase_threshold = std::max(0.01, total_secs / 1000);
+  double increase_threshold = in_between(0.01, total_secs / 1000, 1.0);
   int64_t remaining_dist = sqrtx_ - low_;

   // Most special leaves are below y (~ x^(1/3) * log(x)).
@@ -97,6 +97,7 @@ bool LoadBalancerAC::get_work(ThreadDataAC& thread)
   // segments) by 2x if the thread runtime is close to 0.
   if (low_ > y_ &&
       thread.secs < increase_threshold &&
+      thread.segments == segments_ &&
       thread.segment_size == segment_size_ &&
       segments_ * segment_size_ * (threads_ * 8) < remaining_dist)
   {
@@ -115,14 +116,9 @@ bool LoadBalancerAC::get_work(ThreadDataAC& thread)
   if (is_print_)
     print_status(time);

-  // Update current time because the thread may
-  // have waited to acquire the lock.
-  time = get_time();
-
   thread.low = low_;
   thread.segments = segments_;
   thread.segment_size = segment_size_;
-  thread.secs = time;
   low_ = std::min(low_ + segments_ * segment_size_, sqrtx_);
   segment_nr_++;

